import React from "react";
import Dashboard from "./containers/Dashboard";
import About from "./containers/About";
import Home from "./containers/Home";

const PrivateRoutes = {
  "/home": () => <Home />,
  "/dashboard": () => <Dashboard />,
  "/about": () => <About />,
};

export default PrivateRoutes;
